低消費電力!電気代はスチーム式の1/8(メーカー比)です。お手入れも簡単♪噴霧口は360度、自由回転可能!超音波式なので電源ONからすばやく加湿を開始します。水位センサーでタンク内渇水時に自動で加湿(噴霧)を停止します。電源ヒューズ2.5A付き(安全装置)。新耐熱構造プラグを採用しています。弱酸性次亜塩素酸水を50ppm濃度に水道水で希釈調整して加湿・噴霧すると、気になるお部屋の雑菌や臭いを抑えるのに役に立ちます。<table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">低消費電力!電気代はスチーム式の1/8(メーカー比)です。お手入れも簡単♪噴霧口は360度、自由回転可能!超音波式なので電源ONからすばやく加湿を開始します。水位センサーでタンク内渇水時に自動で加湿(噴霧)を停止します。電源ヒューズ2.5A付き(安全装置)。新耐熱構造プラグを採用しています。弱酸性次亜塩素酸水を50ppm濃度に水道水で希釈調整して加湿・噴霧すると、気になるお部屋の雑菌や臭いを抑えるのに役に立ちます。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">約W170×H295×D287mm</font><br><font color="#333333" size="-1">個装サイズ：34×20×31cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">約2.4kg(水は除く)</font><br><font color="#333333" size="-1">個装重量：3000g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">本体:ABS<br>タンク:AS</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">定格電圧:100V・50/60Hz<br>消費電力:30W<br>水タンク容量:約4.5L<br>加湿量(/h)/最大:約330ml・最小:約120ml<br>加湿目安/木造和室:6畳・洋室:10畳<br>コードの長さ:約1.5m(0.75mm2×2VCTFK)<br>弱酸性次亜塩素酸水適応(株式会社テクノマックスのハセッパー推奨)<br>電流ヒューズ2.5A付き(安全装置)<br>連続加湿時間/最小噴霧時「弱」:約45時間・最大噴霧時「強」:約13～13.5時間</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">付属品</font></td><td align="left"><font color="#333333" size="-1">取扱説明書<br>保証書(保証期間1年)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFF